import { styled } from "styled-components"

export const StyledHomeWork35 = styled.div`
  background-color: #ffdede;
  width: 100%;
  height: 100%;
  max-height: 100%;
  display: flex;
  padding: 5rem;
  display: flex;
  gap: 10rem;
  justify-content: center;
  align-items: center;
  & * {
    transition: all 0.3s ease-in-out;
  }
`
